import React, {useState} from 'react';
import LoginForm from './LoginForm';


const Navbar=()=>{

    const [isModalOpen, setIsModalOpen] = useState(false);

  const handleLogin = () => {
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
  };


    return(
    <>
    <nav className="navbar navbar-expand-lg">
    <ul 
    style={{

    }}
    className="navbar-nav me-auto mb-2 mb-lg-0">
    <li className="nav-item">
        <a className="nav-link active" href="/#">Home</a>
    </li>
    <li className="nav-item">
        <a className="nav-link active" href="/Cuisines">Cuisines</a>
        </li>
        <li className="nav-item">
        <a className="nav-link active" href="/Favorites">My Favorites</a>
        </li>
        <li className="nav-item">
        <a className="nav-link active" href="/Review">Reviews</a>
        </li>
    </ul>
        <div >
        <button 
        style={{
          marginRight:'20px',
        }}
        className="btn btn-dark" onClick={handleLogin}>Login</button> {isModalOpen && (
        <LoginForm handleCloseModal={handleCloseModal} />
      )}
        </div>
    </nav>
    </>
    )
}

export default Navbar;
